measurements.description:
One flower on one 36-cm inflorescence; 
   dorsal sepal flat, white, strongly marked green veins ;
synsepal light green, darker green veins; 
petals spatulate, undulate, cream overlaid chartreuse basally, light rose distally, mahogany spots basal two-thirds;
pouch light green, overlaid light rose, darker rose veins;
 staminode cream, green markings;
substance firm; texture glossy.
